-(IBAction)retryAction:(id)sender
{
    if ([selectedCheckBoxArray count] == 1) {
        
        if ([[ConnectionManager defaultManager] isReachable]) {
            
            if ([self.historyListArray count]) {
                
                retryResponseAlertView = [[UIAlertView alloc]initWithTitle:@"Decision" message:@"Selected data alert logs will be retried?" delegate:self cancelButtonTitle:@"No" otherButtonTitles:@"Yes",nil];
                 [retryResponseAlertView show];
              }
         }
        else{
 
             [self showAlertMessageWithTitle:@"No Network Available" message:@"Retry cannot be performed!" cancelButtonTitle:@"Ok"];
         }
    }
    else if ([selectedCheckBoxArray count] >1){
 
        [self showAlertMessageWithTitle:@"Information" message:@"Please select only one log record to retry" cancelButtonTitle:@"Ok"];
    }
    else
    {
 
          [self showAlertMessageWithTitle:@"Information" message:@"Please select atleast one log record" cancelButtonTitle:@"Ok"];
     }
}


