-(void)showAlertMessageWithTitle:(NSString*)title message:(NSString*)message cancelButtonTitle:(NSString *)cancelBtnTitle withactionType:(NSString *)actionString forMethod:(NSString *)methodNameString
{
    
    
    
    UIAlertController * alert=[UIAlertController alertControllerWithTitle:title
                                                                  message:message
                                                           preferredStyle:UIAlertControllerStyleAlert];
    
    if ([actionString isEqualToString:@"Multiple"]) {
        
        
        UIAlertAction* yesButton = [UIAlertAction actionWithTitle:@"Yes"
                                                            style:UIAlertActionStyleDefault
                                                          handler:^(UIAlertAction * action)
                                    {
                                        if ([methodNameString isEqualToString:@"Delete Logs"])
                                        {
                                             [self deleteLogs];
                                         }
 
                                        // call method whatever u need
                                    }];
        
        UIAlertAction* noButton = [UIAlertAction actionWithTitle:cancelBtnTitle
                                                           style:UIAlertActionStyleDefault
                                                         handler:^(UIAlertAction * action)
                                   {
                                       
 
                                       [alert dismissViewControllerAnimated:YES completion:nil];
                                       
                                   }];
        
        [alert addAction:noButton];
        [alert addAction:yesButton];
        
        [self presentViewController:alert animated:YES completion:nil];
    }
    
    else{
        
        UIAlertAction* okButton = [UIAlertAction actionWithTitle:cancelBtnTitle
                                                           style:UIAlertActionStyleDefault
                                                         handler:^(UIAlertAction * action)
                                   {
                                       
                                       [alert dismissViewControllerAnimated:YES completion:nil];
                                       
                                       
                                       
                                   }];
        
        [alert addAction:okButton];
        
        [self presentViewController:alert animated:YES completion:nil];
        
    }
}


-(void)deleteLogs{
    
    NSMutableArray *objectIds = [NSMutableArray new];
    
    NSMutableArray *indexes = [NSMutableArray new];
    
    NSInteger  number=0;
    
    for (int i=0; i<[selectedCheckBoxArray count]; i++) {
        
        number=number+1;
        
        int  rowIndex  = [[selectedCheckBoxArray objectAtIndex:i] intValue];
        [objectIds addObject:[self.historyListArray objectAtIndex:rowIndex]];
        
        [indexes addObject:[NSNumber numberWithInteger:number]];
        
    }
    
    [self.historyListArray removeObjectsInArray:objectIds];
    
    [selectedCheckBoxArray removeObjectsInArray:indexes];
    
    
    NSMutableArray *finalObjectids=[NSMutableArray new];
    
    for (int i=0; i<[objectIds count]; i++) {
        
        NSMutableArray *tempArray=[NSMutableArray new];
        
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"Date"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"Time"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"DocumentCategory"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"ActivityType"] ];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"User"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"ObjectID"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"Status"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"UUID"]];
        [tempArray addObject:[[objectIds objectAtIndex:i] objectForKey:@"Message"]];
        
        [finalObjectids addObject:tempArray];
        
    }
    
    [[DataBase sharedInstance] deletesynclog:finalObjectids];
    
    [checkBoxHeaderBtn setImage:[UIImage imageNamed:@"radiounselection.png"] forState:UIControlStateNormal];
    [self listOfDataChangeLogHistory];
    
}

