-(void)filterBackGround{
    
    NSPredicate *predicate;
    
    NSMutableString *query = [[NSMutableString alloc] initWithString:@""];
    
    if ([[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:0] objectAtIndex:0] isEqualToString:@"Notification"] && [[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:0] objectAtIndex:1] isEqualToString:@"X"]) {
        
        if ([[defaults objectForKey:@"ViewHistory"] isEqual:@"ONLINE"]) {
            [query appendFormat:@"ZdoctypeText contains[c] 'Notification'"];
        }
        else{
            
            [query appendFormat:@"DocumentCategory contains[c] 'Notification'"];
            
        }
    }
    
    if ([[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:1] objectAtIndex:0] isEqualToString:@"Order"] && [[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:1] objectAtIndex:1] isEqualToString:@"X"]) {
        
        if (query.length) {
            [query appendFormat:@" OR "];
        }
        
        if ([[defaults objectForKey:@"ViewHistory"] isEqual:@"ONLINE"]) {
            
            [query appendFormat:@"ZdoctypeText contains[c] 'Work Order'"];
        }
        else{
            
            [query appendFormat:@"DocumentCategory contains[c] 'Order'"];
            
        }
    }
    
    if ([[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:2] objectAtIndex:0] isEqualToString:@"Reservation"] && [[[[[structuredFilterSortedArray firstObject] objectAtIndex:0] objectAtIndex:2] objectAtIndex:1] isEqualToString:@"X"]) {
        
        if (query.length) {
            [query appendFormat:@" OR "];
        }
        
        if ([[defaults objectForKey:@"ViewHistory"] isEqual:@"ONLINE"]) {
            [query appendFormat:@"ZdoctypeText contains[c] 'Reservation'"];
        }
        else{
            [query appendFormat:@"DocumentCategory contains[c] 'Reservation'"];
        }
    }
    
    if (query.length) {
        
        predicate = [NSPredicate predicateWithFormat:query];
        
        if (self.filteredArray == nil) {
            self.filteredArray = [[NSArray alloc]init];
        }
        
        self.filteredArray = [self.historyListArray filteredArrayUsingPredicate:predicate];
        
        headerLabel.text = [NSString stringWithFormat:@"User Log (%i)",(int)[self.filteredArray count]];
        
        historyTableview.tag = 1;
    }
    else{
        historyTableview.tag = 0;
        headerLabel.text = [NSString stringWithFormat:@"User Log (%i)",(int)[self.historyListArray count]];
    }
 
    [historyTableview reloadData];
 }


-(void)listOfUserTransactionHistory{
    
    deleteImageBtn.hidden=YES;
    retryBtn.hidden = YES;
    
     hud = [MBProgressHUD showHUDAddedTo:self.view animated:YES];
     hud.mode = MBProgressHUDModeIndeterminate;
     hud.label.text = @"Transaction history is loading...";
    
    NSMutableDictionary *searchDictionary = [[NSMutableDictionary alloc]init];
    
    [searchDictionary setObject:decryptedUserName forKey:@"REPORTEDBY"];
    
    if ([[ConnectionManager defaultManager] isReachable]) {
        
        [searchDictionary setObject:@"F4" forKey:@"ACTIVITY"];
        [searchDictionary setObject:@"D2" forKey:@"DOCTYPE"];
        [searchDictionary setObject:[defaults objectForKey:@"ENDPOINT"] forKey:@"ENDPOINT"];
        NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:searchDictionary];
        if ([endPointArray count]) {
            NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
            [searchDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
        }
        
        [Request makeWebServiceRequest:GET_LOG_DATA parameters:searchDictionary delegate:self];
    }
    else{
        
        [MBProgressHUD hideHUDForView:self.view animated:YES];

        if ([[defaults objectForKey:@"ACTIVATELOGS"] isEqualToString:@"X"])
        {
            [[DataBase sharedInstance] writToLogFile:[NSString stringWithFormat:@"#INFO#.com.enstrapp.fieldtekpro# #Activity: User History  #Mode:Offline"]];
        }
        else if ([[defaults objectForKey:@"ACTIVATELOGS"] isEqualToString:@" "])
        {
         }
 
        [self showAlertMessageWithTitle:@"No Network Available" message:@"Please Check Your Network Connection" cancelButtonTitle:@"Ok"];
        
     }
    return;
}


