-(NSInteger)tableView:(UITableView *)tableView numberOfRowsInSection:(NSInteger)section{
    
    if (tableView == historyTableview)
    {
        UILabel *noDataLabel = [[UILabel alloc] initWithFrame:CGRectMake(0, 0, tableView.bounds.size.width, tableView.bounds.size.height)];
        noDataLabel.textAlignment = NSTextAlignmentCenter;
        tableView.backgroundView = noDataLabel;
        tableView.separatorStyle = UITableViewCellSeparatorStyleNone;
        
        if (historyTableview.tag == 1) {
            
            if ([self.filteredArray count]) {
                noDataLabel.text = @"";
                noDataLabel.textColor = [UIColor grayColor];
                return _filteredArray.count;
            }
            else{
                noDataLabel.text = @"No data available";
                noDataLabel.textColor  = [UIColor grayColor];
            }
        }
        else
        {
            if ([self.historyListArray count]) {
                noDataLabel.text = @"";
                noDataLabel.textColor = [UIColor grayColor];
                return [self.historyListArray count];
            }
            else{
                noDataLabel.text = @"No data available";
                noDataLabel.textColor  = [UIColor grayColor];
            }
        }
    }
    else if (tableView == sortTableView){
        
        return [[[structuredFilterSortedArray firstObject] firstObject] count];
    }
    
    return 0;
}

