-(NSIndexPath *) GetCellFromTableView: (UITableView *)tableView Sender:(id)sender
{
    CGPoint position = [sender convertPoint:CGPointZero toView:tableView];
    NSIndexPath *indexPath = [tableView indexPathForRowAtPoint:position];
    return indexPath;//[tableView cellForRowAtIndexPath:indexPath];
}

-(void)tableView:(UITableView *)tableView didSelectRowAtIndexPath:(NSIndexPath *)indexPath
{
    if(tableView==sortTableView)
    {
        if ([[[[[structuredFilterSortedArray firstObject] objectAtIndex:indexPath.section] objectAtIndex:indexPath.row] objectAtIndex:1] isEqualToString:@"X"])
        {
            [[[[structuredFilterSortedArray firstObject]objectAtIndex:indexPath.section] objectAtIndex:indexPath.row] replaceObjectAtIndex:1 withObject:@""];
        }
        else{
            
            [[[[structuredFilterSortedArray firstObject] objectAtIndex:indexPath.section] objectAtIndex:indexPath.row] replaceObjectAtIndex:1 withObject:@"X"];
            
        }
    }
    
    [sortTableView reloadData];
    
}

-(void)logsCheckBoxClicked:(id)sender{
    [checkBoxHeaderBtn setImage:[UIImage imageNamed:@"radiounselection.png"] forState:UIControlStateNormal];
    checkBoxHeaderBtn.selected = NO;
    
    NSIndexPath *ip = [self GetCellFromTableView:historyTableview Sender:sender];
    NSInteger i = ip.row;
    
    UIButton *tappedButton = (UIButton*)sender;
    
    if([tappedButton.currentImage isEqual:[UIImage imageNamed:@"radiounselection.png"]]) {
        [sender  setImage:[UIImage imageNamed: @"radioselection.png"] forState:UIControlStateNormal];
        
        [selectedCheckBoxArray addObject:[NSNumber numberWithInteger:i]];
    }
    else{
        [selectedCheckBoxArray removeObject:[NSNumber numberWithInteger:i]];
        
        [sender setImage:[UIImage imageNamed:@"radiounselection.png"]forState:UIControlStateNormal];
    }
}

-(IBAction)selectAllCheckBox:(id)sender{
    
    if (!checkBoxHeaderBtn.selected) {
        checkBoxHeaderBtn.selected = YES;
        [checkBoxHeaderBtn setImage:[UIImage imageNamed:@"radioselection.png"] forState:UIControlStateNormal];
    }
    else{
        checkBoxHeaderBtn.selected = NO;
        [checkBoxHeaderBtn setImage:[UIImage imageNamed:@"radioinselection.png"] forState:UIControlStateNormal];
    }
    
    [historyTableview reloadData];
}

- (void)stopCurrentConnetion
{
    [Request stopRequest];
    [self.activeConnectionRequestQueue removeAllObjects];
    [self.pendingConnectionRequestQueue removeAllObjects];
    
    [MBProgressHUD hideHUDForView:self.view animated:YES];
}

- (void)startNextConnection
{
    if ([self.pendingConnectionRequestQueue count]) {
        
        if ([self.activeConnectionRequestQueue count]) {
            [self.pendingConnectionRequestQueue removeObjectAtIndex:0];
        }
        
        [self.activeConnectionRequestQueue removeAllObjects];
        
        if([self.pendingConnectionRequestQueue count])
        {
            for (int i=0; i<[self.pendingConnectionRequestQueue  count]; i++) {
                
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"Date"]];
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"Time"]];
                
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"DocumentCategory"]];
                
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"ActivityType"] ];
                
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"User"]];
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"ObjectID"]];
                
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"Status"]];
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"UUID"]];
                [self.activeConnectionRequestQueue addObject:[[self.pendingConnectionRequestQueue objectAtIndex:0] objectForKey:@"Message"]];
            }
            
            [self startConnection];
            
            return;
        }
        else{
            
            [self listOfDataChangeLogHistory];
            
            [MBProgressHUD hideHUDForView:self.view animated:YES];
        }
    }
    else{
        
        [self listOfDataChangeLogHistory];
        
        [MBProgressHUD hideHUDForView:self.view animated:YES];
    }
}

