- (void)startConnection
{
    if ([self.activeConnectionRequestQueue count]) {
        
        if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Notification"] && ([[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"ERROR"] || [[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"New"])){
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Create"]) {
                
                [Request makeWebServiceRequest:NOTIFICATION_CREATE parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Change"]) {
                
                [Request makeWebServiceRequest:NOTIFICATION_CHANGE parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Release"]){
                NSMutableDictionary *endPointReleaseNotificationDictionary = [NSMutableDictionary dictionaryWithObject:[NSMutableArray arrayWithObject:[NSString stringWithString:[self.activeConnectionRequestQueue objectAtIndex:5]]] forKey:@"ITEMS"];
                
                [endPointReleaseNotificationDictionary setObject:[[decryptedUserName copy] uppercaseString] forKey:@"REPORTEDBY"];
                
                [endPointReleaseNotificationDictionary setObject:@"SYNC" forKey:@"TRANSMITTYPE"];
                
                [endPointReleaseNotificationDictionary setObject:@"RL" forKey:@"ACTIVITY"];
                [endPointReleaseNotificationDictionary setObject:@"Q" forKey:@"DOCTYPE"];
                [endPointReleaseNotificationDictionary setObject:@"SOAP" forKey:@"ENDPOINT"];
                
                NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:endPointReleaseNotificationDictionary];
                NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
                [endPointReleaseNotificationDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
                
                [Request makeWebServiceRequest:NOTIFICATION_RELEASE parameters:endPointReleaseNotificationDictionary delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Cancel"]) {
                NSMutableDictionary *endPointCancelNotificationDictionary = [NSMutableDictionary dictionaryWithObject:[NSMutableArray arrayWithObject:[NSString stringWithString:[self.activeConnectionRequestQueue objectAtIndex:5]]] forKey:@"ITEMS"];
                [endPointCancelNotificationDictionary setObject:[decryptedUserName uppercaseString] forKey:@"REPORTEDBY"];
                [endPointCancelNotificationDictionary setObject:@"SYNC" forKey:@"TRANSMITTYPE"];
                [endPointCancelNotificationDictionary setObject:@"X" forKey:@"ACTIVITY"];
                [endPointCancelNotificationDictionary setObject:@"Q" forKey:@"DOCTYPE"];
                [endPointCancelNotificationDictionary setObject:@"SOAP" forKey:@"ENDPOINT"];
                NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:endPointCancelNotificationDictionary];
                NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
                [endPointCancelNotificationDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
                
                [Request makeWebServiceRequest:NOTIFICATION_CANCEL parameters:endPointCancelNotificationDictionary delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Complete"]) {
                NSMutableDictionary *endPointCompleteNotificationDictionary = [NSMutableDictionary dictionaryWithObject:[NSMutableArray arrayWithObject:[NSString stringWithString:[self.activeConnectionRequestQueue objectAtIndex:5]]] forKey:@"ITEMS"];
                [endPointCompleteNotificationDictionary setObject:[decryptedUserName uppercaseString] forKey:@"REPORTEDBY"];
                [endPointCompleteNotificationDictionary setObject:@"SYNC" forKey:@"TRANSMITTYPE"];
                
                [endPointCompleteNotificationDictionary setObject:@"S" forKey:@"ACTIVITY"];
                [endPointCompleteNotificationDictionary setObject:@"Q" forKey:@"DOCTYPE"];
                [endPointCompleteNotificationDictionary setObject:@"SOAP" forKey:@"ENDPOINT"];
                NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:endPointCompleteNotificationDictionary];
                NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
                [endPointCompleteNotificationDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
                
                [Request makeWebServiceRequest:NOTIFICATION_COMPLETE parameters:endPointCompleteNotificationDictionary delegate:self];
            }
        }
        else if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Order"] && ([[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"ERROR"] || [[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"New"])){
            
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Create"]) {
                [Request makeWebServiceRequest:ORDER_CREATE parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Change"]){
                [Request makeWebServiceRequest:ORDER_CHANGE parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Cancel"]){
                NSMutableDictionary *endPointCancelOrderDictionary = [NSMutableDictionary dictionaryWithObject:[NSMutableArray arrayWithObject:[NSString stringWithString:[self.activeConnectionRequestQueue objectAtIndex:5]]] forKey:@"ITEMS"];
                [endPointCancelOrderDictionary setObject:[decryptedUserName uppercaseString] forKey:@"REPORTEDBY"];
                [endPointCancelOrderDictionary setObject:@"SYNC" forKey:@"TRANSMITTYPE"];
                [endPointCancelOrderDictionary setObject:@"X" forKey:@"ACTIVITY"];
                [endPointCancelOrderDictionary setObject:@"W" forKey:@"DOCTYPE"];
                [endPointCancelOrderDictionary setObject:@"SOAP" forKey:@"ENDPOINT"];
                NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:endPointCancelOrderDictionary];
                NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
                [endPointCancelOrderDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
                
                [Request makeWebServiceRequest:ORDER_CANCEL parameters:endPointCancelOrderDictionary delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Release"]){
                NSMutableDictionary *endPointReleaseOrderDictionary = [NSMutableDictionary dictionaryWithObject:[NSMutableArray arrayWithObject:[NSString stringWithString:[self.activeConnectionRequestQueue objectAtIndex:5]]] forKey:@"ITEMS"];
                
                [endPointReleaseOrderDictionary setObject:[[decryptedUserName copy] uppercaseString] forKey:@"REPORTEDBY"];
                
                [endPointReleaseOrderDictionary setObject:@"" forKey:@"TRANSMITTYPE"];
                
                [endPointReleaseOrderDictionary setObject:@"RL" forKey:@"ACTIVITY"];
                [endPointReleaseOrderDictionary setObject:@"W" forKey:@"DOCTYPE"];
                [endPointReleaseOrderDictionary setObject:@"SOAP" forKey:@"ENDPOINT"];
                
                NSArray *endPointArray = [[DataBase sharedInstance] getEndPointURL:endPointReleaseOrderDictionary];
                NSLog(@"endPoint :%@",[[endPointArray objectAtIndex:0] objectAtIndex:0]);
                [endPointReleaseOrderDictionary setObject:[[endPointArray objectAtIndex:0] objectAtIndex:0] forKey:@"URL_ENDPOINT"];
                
                [Request makeWebServiceRequest:ORDER_RELEASE parameters:endPointReleaseOrderDictionary delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Confirm"]){
                [Request makeWebServiceRequest:ORDER_CONFIRM parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
            else if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Collective Confirm"]){
                
                [Request makeWebServiceRequest:ORDER_COLLECTIVE_CONFIRMATION parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
        }
        else if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Notification & Order"]){
            
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Create"]) {
                [Request makeWebServiceRequest:CREATE_NOTIF_ORDER parameters:[[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue] delegate:self];
            }
        }
        else if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Reservation"] && ([[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"ERROR"] || [[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"New"])){
            
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Reserve"]) {
                NSMutableDictionary *reserveDictionary = [[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue];
                [reserveDictionary setObject:decryptedUserName forKey:@"REPORTEDBY"];
                [Request makeWebServiceRequest:UTILITY_RESERVE parameters:reserveDictionary delegate:self];
            }
        }
        else if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Inspection"] && ([[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"ERROR"] || [[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"New"])){
            
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Inspection"]) {
                NSMutableDictionary *reserveDictionary = [[DataBase sharedInstance] getDataForSyncLog:self.activeConnectionRequestQueue];
                [reserveDictionary setObject:decryptedUserName forKey:@"REPORTEDBY"];
                [Request makeWebServiceRequest:MONITOR_SET_EQUIP_MDOCS parameters:reserveDictionary delegate:self];
            }
        }
        
        else{
            
            [MBProgressHUD hideHUDForView:self.view animated:YES];
        }
    }
}

