                }
                
                else if ([parsedDictionary objectForKey:@"MESSAGE"])
                {
                    
                    UIAlertView *alert = [[UIAlertView alloc]initWithTitle:@"info" message:[parsedDictionary objectForKey:@"MESSAGE"] delegate:nil cancelButtonTitle:@"Ok"
                                                         otherButtonTitles: nil];
                    
                    [alert show];
                }
                
            }
            
            else{
                
                UIAlertView  *alertFailure = [[UIAlertView alloc]initWithTitle:@"Information" message:errorDescription delegate:nil cancelButtonTitle:@"OK" otherButtonTitles: nil];
                
                [alertFailure show];
                
            }
            
            
            break;
            
            
            
        default:
            break;
    }
    
    if (errorDescription.length) {
        [self stopCurrentConnetion];
    }
    if ([self canStartNextConnection]) {
        [self startNextConnection];
    }
}

 

